import React from "react";

const Home = () => {
  return (
    <div>
      <div class="font-bold text-3xl text-center max-w-2xl mx-auto mt-12 bg-gradient-to-r from-indigo-600 to-pink-600 bg-clip-text text-transparent">
        When something is important enough, you do it even if the odds are not
        in your favor. <span>Elon Musk</span>
      </div>
    </div>
  );
};

export default Home;
